import { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';

const FadeIn = ({ children, option }) => {
  useEffect(() => {
    AOS.init({ duration: 2000 });
  }, []);
  return <div data-aos={option}>{children}</div>;
};

export default FadeIn;
